import './App.css';
import Layout from './components/Layout/Layout';
import Modal from './components/Modal/Modal';

function App() {
  return (
    <div className="App">
      <div className='page__wrapper'>
        <Layout />
      </div>
      <button type="button" onClick={() => setIsModalOpen(true)}>
        Добавить элемент
      </button>
      <Modal/>
    </div>
  );
}

export default App;
